import React from "react";
import s from './My_post.module.css';

function My_post() {
    return (
        <div className={s.post}>
            <img src="https://qph.fs.quoracdn.net/main-qimg-c1f256f3116c78e542fa40ba999ba849.webp" alt="kaneki"/>
            Hello, guy
            <div>
                <img src="https://lh3.googleusercontent.com/proxy/Zh51cZSsHO6Xq8aF-IukWcy3rZiNXUkJ6Qjxfx8MCojSot6YygH0PP9Nt6iaHPUmsxKmjsWRCgUbQ4UHe3iQMroZWaxU6qu0j04Dg6Bg3hnlctvvhC6o70RB0bpRTJMiog" alt=""/>
                <img src="" alt=""/>
            </div>
        </div>)
}

export default My_post;
